import React from 'react';
import './Rect.css';
import img_calendar from './Saly-42.png'
import img_shakehands from './Saly-31.png'

function LeftRectangle() {
    return (
        <div>
            <button className='rect'>
                <img className='calendar' src={img_calendar} />
                <text className='title'>
                    Fast & Easy
                </text>
                <text className='body'>
                    <br/>AVIEW guarantees a 24-hour<br/>turnaround on subtitle and 48<br/>hours on dubbed content.
                </text>
            </button>
        </div>
    )
}
export default LeftRectangle
